import React from 'react';

export const About = () => {
    return (
        <div>
            <h2>Natural rubber at its finest</h2>
            <p>Hand made grips in natural rubber good for your hands and for the environment</p>
            <p>Designed with grippyness in mind</p>
        </div>
    )
}
